import { describe, it, before } from 'mocha'
import { expect } from 'chai'
import { wait, open } from './helpers'

describe('Import Image', () => {
  let child

  before(async () => {
    child = await open('/base/examples/import-image/index.html')
  })

  it('Import image from URL', async () => {
    while (!child.find('.loaded').html()) await wait(100)

    expect(child.find('.image-1').attr('src')).to.equal(image1DataUrl)
    expect(child.find('.image-2').attr('src')).to.equal(image2DataUrl)
  }).timeout(20000)
})

const image1DataUrl = 'data:image/png;base64,'
const image2DataUrl = 'data:image/svg+xml;base64,'
